  svt_err_check_stats illegal_tx_rx_state_transition_combinations_from_async_input_race_state;

  /**
   * @groupname chi_link_err_timeout_check
   * @check_description   
   * lasm is acronym for "Link Active State Machine". <br>
   * A given components Link Active State Machine entry into Async Input Race states can happen when there is a Banned Output Signal race condition at the connected link partner component. <br>
   * The component observing Link Active States corresponding to Async Input race condition, it is expected that the Link Active State machine immediately moved to next valid states within 1 or few clock cycles, initiated by link partner component. <br>
   * When a component’s state machine stays in Async Input Race state for more than the programmed clock cycles through the configuration parameter svt_chi_node_configuration::async_input_banned_output_race_link_active_states_timeout, a timeout error is issued. <br>
   * This check is constructed and executed only when svt_chi_node_configuration::allow_link_active_signal_banned_output_race_transitions is set to 1 and svt_chi_node_configuration::async_input_banned_output_race_link_active_states_timeout set to a value greater than or equal to 1.
   * @end_check_description
   *
   * @check_pass
   * When the component observing Link active State Machine in Async Input race states moved to next valid state within the value specified in svt_chi_node_configuration::async_input_banned_output_race_link_active_states_timeout.
   * @end_check_pass
   *
   * @check_fail
   * When the component observing Link active State Machine in Async Input race states not moved to next valid state within the value specified in svt_chi_node_configuration::async_input_banned_output_race_link_active_states_timeout.
   * @end_check_fail
   *
   * @applicable_device_type
   * RN 
   * @end_applicable_device_type
   *
   * @check_additional_information
   * By default this check is not executed, must program the node configuration parameter svt_chi_node_configuration::async_input_banned_output_race_link_active_states_timeout to a value greater than or equal to 1 for this check to be performed. <br>
   * This check uses the node configuration parameter svt_chi_node_configuration::async_input_banned_output_race_link_active_states_timeout, which must be programmed taking into consideration all other link active state machine delays. As the component's Link active State Machine movement from Async Input race state to next valid state depends on the link partner component's movement from Banned Output Race states to next valid state, the link partner component delays to move from Banned Output Race states to next valid state should be programmed appropriately.
   * @end_check_additional_information     
   */
  svt_err_check_stats lasm_in_async_input_race_state_timeout_check;

  /**
   * @groupname chi_link_err_timeout_check
   * @check_description   
   * lasm is acronym for "Link Active State Machine". <br>
   * A given components Link Active State Machine entry into Banned Output Race states can happen when there is Async Input Signal race condition at the connected link partner component. <br>
   * The component observing Link Active States corresponding to Banned Output race condition, it is expected that the Link Active State machine immediately moved to next valid states within 1 or few clock cycles, initiated by link partner component. <br>
   * When a component’s state machine stays in Banned Output Race state for more than the programmed clock cycles through the configuration parameter svt_chi_node_configuration::async_input_banned_output_race_link_active_states_timeout, a timeout error is issued. <br>
   * This check is constructed and executed only when svt_chi_node_configuration::allow_link_active_signal_banned_output_race_transitions is set to 1 and svt_chi_node_configuration::async_input_banned_output_race_link_active_states_timeout set to a value greater than or equal to 1.
   * @end_check_description
   *
   * @check_pass
   * When the component observing Link active State Machine in Banned Output race states moved to next valid state within the value specified in svt_chi_node_configuration::async_input_banned_output_race_link_active_states_timeout.
   * @end_check_pass
   *
   * @check_fail
   * When the component observing Link active State Machine in Banned Output race states not moved to next valid state within the value specified in svt_chi_node_configuration::async_input_banned_output_race_link_active_states_timeout.
   * @end_check_fail
   *
   * @applicable_device_type
   * RN
   * @end_applicable_device_type
   *
   * @check_additional_information
   * By default this check is not executed, must program the node configuration parameter svt_chi_node_configuration::async_input_banned_output_race_link_active_states_timeout to a value greater than or equal to 1 for this check to be performed. <br>
   * This check uses the node configuration parameter svt_chi_node_configuration::async_input_banned_output_race_link_active_states_timeout, which must be programmed taking into consideration all other link active state machine delays. The Link Active State Machine delays that user needs to pay attention to are delay controls(to move to next valid state) in Banned Output Race states:
   * - svt_chi_node_configuration::txla_req_assertion_when_rx_in_run_state_delay
   * - svt_chi_node_configuration::txla_req_deassertion_when_rx_in_stop_state_delay
   * - svt_chi_node_configuration::rxla_ack_assertion_when_tx_in_deactivate_state_delay
   * - svt_chi_node_configuration::rxla_ack_deassertion_when_tx_in_activate_state_delay
   * .
   * @end_check_additional_information     
   */
  svt_err_check_stats lasm_in_banned_output_race_state_timeout_check;

  /**
   * @groupname chi_link_err_timeout_check
   * @check_description   
   * lasm is acronym for "Link Active State Machine". <br>
   * A given component Link Active State Machine entry into Async Input Race States can only be reached by observing a race between the two input signals. <br>
   * In other words, entry into Async Input Race states for a given component can happen only when the connected link partner component observes a Banned Output Signal race condition. <br>
   * A given component Link Active State Machine entry into Async Input Race state implies that the connected link partner copmonent has entered Banned Output Race state. <br>
   * When a component’s Link Active State Machine entry into Async Input Race state is observed this check will fail, if not the check will pass. <br>
   * This check is constructed and executed only when svt_chi_node_configuration::is_link_active_state_machine_in_async_input_race_state_expected is set to 0.
   * @end_check_description
   *
   * @check_pass
   * When the component Link Active State Machine doesn't enter into Async Input Race State.
   * @end_check_pass
   *
   * @check_fail
   * When the component Link Active State Machine entry into Async Input Race State is observed. The check will fail for below Link Active State Machine transitions:
   * - TX_ACTIVATE RX_STOP to TX_RUN+ RX_STOP 
   * - TX_ACTIVATE RX_RUN to TX_ACTIVATE RX_DEACTIVATE+
   * - TX_DEACTIVATE RX_RUN to TX_STOP+ RX_RUN
   * - TX_DEACTIVATE RX_STOP to TX_DEACTIVATE RX_ACTIVATE+
   * .
   * @end_check_fail
   *
   * @applicable_device_type
   * RN and SN 
   * @end_applicable_device_type
   *
   * @check_additional_information
   * This check will be constructed and executed only when the node configuration parameter svt_chi_node_configuration::is_link_active_state_machine_in_async_input_race_state_expected is set to 0. <br>
   * Use case:
   * - For a given component, the node configuration parameter svt_chi_node_configuration::is_link_active_state_machine_in_async_input_race_state_expected can be set to 0 (which inturn enables this check) for below cases: 
   *   - An error needs to be thrown when the component's Link Active State Machine to enter into Async Input Race State
   *   - An error needs to be thrown when the connected link partner component's Link Active State Machine to enter into Banned Output Race State
   *   .
   * .
   * .
   * @end_check_additional_information     
   */
  svt_err_check_stats lasm_entry_into_async_input_race_state_check;

  /**
   * @groupname chi_link_err_timeout_check
   * @check_description   
   * lasm is acronym for "Link Active State Machine". <br>
   * A given component's Link Active State Machine entry into Banned Output Race states can happen when there is a race condition at the output signals of the local component. <br>
   * A given component's Link Active State Machine entry into Banned Output Race states results in the connected link partner component being entering Async Input Race States. <br>
   * When a component’s Link Active State Machine entry into Banned Output Race state is observed this check will fail, if not the check will pass. <br>
   * This check is constructed and executed only when svt_chi_node_configuration::is_link_active_state_machine_in_banned_output_race_state_expected is set to 0.
   * @end_check_description
   *
   * @check_pass
   * When the component Link Active State Machine doesn't enter into Banned Output Race State.
   * @end_check_pass
   *
   * @check_fail
   * When the component Link Active State Machine entry into Banned Output Race State is observed. The check will fail for below Link Active State Machine transitions:
   * - TX_STOP RX_ACTIVATE to TX_STOP RX_RUN+
   * - TX_RUN RX_ACTIVATE to TX_DEACTIVATE+ RX_ACTIVATE
   * - TX_RUN RX_DEACTIVATE to TX_RUN RX_STOP+ 
   * - TX_STOP RX_DEACTIVATE to TX_ACTIVATE+ RX_DEACTIVATE
   * .
   * @end_check_fail
   *
   * @applicable_device_type
   * Passive RN and Passive SN 
   * @end_applicable_device_type
   *
   * @check_additional_information
   * This check will be constructed and executed only when the node configuration parameter svt_chi_node_configuration::is_link_active_state_machine_in_banned_output_race_state_expected is set to 0. <br>
   * Use case:
   * - For a given component, the node configuration parameter svt_chi_node_configuration::is_link_active_state_machine_in_banned_output_race_state_expected can be set to 0 (which inturn enables this check) for below cases: 
   *   - An error needs to be thrown when the component's Link Active State Machine to enter into Banned Output Race State
   *   - An error needs to be thrown when the connected link partner component's Link Active State Machine to enter into Async Input Race State
   *   .
   * .
   * @end_check_additional_information     
   */
  svt_err_check_stats lasm_entry_into_banned_output_race_state_check;
  
  /**
